import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const  Home = () => {
    return(
        <Container fluid="xs">
            <Row>
                <Col xs={12} md={7} lg={7} style={{backgroundColor : 'red'}}>
                xs=12 md=8
                </Col>
                <Col xs={12} md={5} lg={5} style={{backgroundColor : 'green'}}>
                xs=6 md=4
                </Col>
            </Row>
        </Container>
    ) 
}

export default Home;
